var tcjsonobject = JSON.parse(tcjson);
var dexobject = JSON.parse(dexjson);

describe('type chart json', function () {
	var tc = new TypeChart(tcjsonobject);
	it('can be deserialized', function () {
		expect(tc.Lines.length).toBe(171);
		expect(tc.Lines[0].Type.length).toBe(1);
		expect(tc.Lines[0].Type[0]).toBe("Normal");
		expect(tc.Lines[0].AttackedBy("Ghost")).toBe("x0");
	});
	it('line can self identify', function () {
		var line = tc.Lines[0];
		expect(line.Is(["Normal"])).toBe(true);
		expect(line.Is(["Normal", "Ghost"])).toBe(false);
	});
	it('can fetch line for types', function () {
		var line = tc.ForType(["Normal"]);
		expect(line.AttackedBy("Ghost")).toBe("x0");
	});

	it('can fetch line for fight attacked by fairy', function () {
		var line = tc.ForType(["Fighting"]);
		expect(line.AttackedBy("Fairy")).toBe("x2");
	});

	it('can fetch line for fairy attacked by dark', function () {
		var line = tc.ForType(["Fairy"]);
		expect(line.AttackedBy("Dark")).toBe("x0.5");
	});
	it('can fetch line for firewater attacked by steel', function () {
		var line = tc.ForType(["Fire", "Water"]);
		expect(line.AttackedBy("Steel")).toBe("x0.25");
	});
});

describe('dex object', function () {
	var d = new Dex(dexobject);
	var tc = new TypeChart(tcjsonobject);
	it('contains all names', function () {
		expect(d.Names.length).toBe(719);
		expect(d.Names[0]).toBe("Bulbasaur");
	});

	it('can be created from serialized json', function () {
		expect(d.Entries.length).toBe(719);
		expect(d.Entries[0].Name).toBe("Bulbasaur");
		expect(d.Entries[0].Types[0]).toBe("Grass");
		expect(d.Entries[0].Types[1]).toBe("Poison");
		expect(d.Entries[0].MoveSet[10].Level).toBe(27);
		expect(d.Entries[0].MoveSet[10].Type).toBe("Normal");
	});
	it('can create list of effectivness from name', function () {
		var b = d.Select("Snorlax", tc);
		expect(b.Name).toBe("Snorlax");
		expect(b.Attack[0].Label).toBe("x2");
		expect(b.Attack.length).toBe(2);
		expect(b.Attack[0].Type).toBe("Fighting");
		expect(b.Attack[1].Label).toBe("x0");
		expect(b.Attack[1].Type).toBe("Ghost");
	});
	it('can list of possible move types', function () {
		var b = d.Select("Snorlax", tc);
		expect(b.PossibleTypes.length).toBe(6);
		expect(b.PossibleTypes[0]).toBe("Normal");
		expect(b.PossibleTypes[1]).toBe("Psychic");
		expect(b.PossibleTypes[2]).toBe("Ghost");
		expect(b.PossibleTypes[3]).toBe("Rock");
		expect(b.PossibleTypes[4]).toBe("Dark");
		expect(b.PossibleTypes[5]).toBe("Steel");
	});
	it('can optionally list known types for level', function () {
		var b = d.Select("Snorlax", tc, 41);
		expect(b.LevelTypes.length).toBe(2);
		expect(b.LevelTypes[0]).toBe("Normal");
		expect(b.LevelTypes[1]).toBe("Rock");
	});
	it('can optionally list known types for other level', function () {
		var b = d.Select("Snorlax", tc, 40);
		expect(b.LevelTypes.length).toBe(3);
		expect(b.LevelTypes[0]).toBe("Normal");
		expect(b.LevelTypes[1]).toBe("Rock");
		expect(b.LevelTypes[2]).toBe("Psychic");
	});
});
